    CommonViewPageComponent.prototype.query = function () {
        var _this = this;
        if (!this.isGroupBatch && this.isNotCardElement) {
            this.applyAmt();
        }
        this.viewId = JSON.parse(this.commfunc.getSessionDataCH('viewId'));
        var viewConfigId = [];
        var viewName = [];
        this.viewId.forEach(function (e) {
            viewConfigId.push(e.a);
            viewName.push(e.b);
        });
        var param = {
            'viewConfigId': viewConfigId,
            'viewName': viewName
        };
        this.creditCcmService.queryAllSourcesForView(param).subscribe(function (data) {
            if (data.returnCode.code === 'success') {
                if (_this.isoutcard) {
                    if (_this.commonHeader.extParam.managePermission == 'N') {
                        var item = JSON.parse(_this.commfunc.getSessionDataCH('workType'));
                        if (item.worktype !== 5 && item.worktype !== 4 && item.worktype !== 7) {
                            for (var i = 0; i < data.list.length; i++) {
                                if (data.list[i].bookmarkId !== '1010005') {
                                    _this.bookmarkList.push(data.list[i]);
                                }
                            }
                        }
                        else {
                            _this.bookmarkList = data.list;
                        }
                        var userId = JSON.parse(_this.commfunc.getSessionData('commonHeader')).userId;
                        if (_this.investiGatorName2 == userId) {
                            _this.bookmarkList = data.list;
                        }
                    }
                    else {
                        if (_this.commfunc.getSessionDataCH('workType')) {
                            var item = JSON.parse(_this.commfunc.getSessionDataCH('workType'));
                            if (item.worktype !== 5 && item.worktype !== 4 && item.worktype !== 7 && _this.isGroupBatch && _this.isBatchCreditTwo) {
                                for (var i = 0; i < data.list.length; i++) {
                                    if (data.list[i].bookmarkId !== '1010005' && data.list[i].bookmarkName != "审批意见" && data.list[i].bookmarkName != "审批意见2") {
                                        _this.bookmarkList.push(data.list[i]);
                                    }
                                }
                            }
                            else {
                                _this.bookmarkList = data.list;
                            }
                            // this.bookmarkList = data.list;
                        }
                        else {
                            _this.bookmarkList = data.list;
                        }
                    }
                }
                else {
                    _this.bookmarkList = data.list;
                }
                // this.queryDynamicProductAttributeOrValue()
                for (var i = 0; i < _this.bookmarkList.length; i++) {
                    if (_this.bookmarkList[i].bookmarkId == '1010007') {
                        _this.isPaymentPlan = true;
                        break;
                    }
                }
                if (!_this.transferCreditBean.isPreview) {
                    // 等组件加载完毕后，再发送查询第一个页签内资源页面的查询事件广播
                    setTimeout(function () {
                        _this.triggerChildComponentsQuery(_this.bookmarkList[0]);
                    }, 1000);
                }
            }
            else {
                _this.msgs = [{ severity: 'error', summary: '错误', detail: data.returnCode.message }];
            }
        });
    };
