    CommonViewPageComponent.prototype.checkMaxContractStatus = function (resolve) {
        var _this = this;
        // console.log("ad")
        var params = {
            custRequestNo: this.data.transferCreditData['custRequestNo'],
            processId: this.data.transferCreditData['processId']
        };
        return this.creditCcmService.checkMaxContractStatus(params).subscribe(function (data) {
            if (data.returnCode.code === 'success') {
                if (data.maxContractStatus == 'S') {
                    resolve({
                        maxStatus: true
                    });
                    //  return true;
                }
                else {
                    _this.tipMessages = data.tipMessages;
                    resolve({
                        maxStatus: false
                    });
                    // return false;
                }
            }
            else {
                _this.tipMessages = data.returnCode.message;
                _this.msgs = [{ severity: 'error', summary: '提示', detail: data.returnCode.message }];
                resolve({
                    maxStatus: false
                });
                // return false;
            }
        });
    };
