    //例外审批检查规则(入参)
    CommonViewPageComponent.prototype.validateRules = function () {
        var _this = this;
        var createBean = JSON.parse(this.commfunc.getSessionDataCH('createBean'));
        if (!createBean) {
            this.submitFlag = false;
            this.maskLayer = false;
            this.msgs = [];
            this.msgs = [{ severity: 'error', summary: '提示', detail: '请保存授信信息！' }];
        }
        this.validateRulesBean.custNo = createBean['creditMap']['custNo']; //借款人客户号
        this.validateRulesBean.custName = createBean['creditMap']['custName']; //借款人名称
        this.validateRulesBean.custAttr = this.custAttribute; //借款人类型
        this.validateRulesBean.orgCode = createBean['creditMap']['tellerOrgNo']; //申请机构
        this.validateRulesBean.productNo = createBean['creditMap']['productNo']; //产品编号
        this.validateRulesBean.applyDate = createBean['creditMap']['applyDate'].replace(/-/g, ''); //贷款时间
        this.validateRulesBean.matureDate = createBean['creditMap']['endDate'].replace(/-/g, ''); //贷款结束时间
        // this.validateRulesBean.applyAmt = createBean['creditMap']['applyAmt'];//申请金额
        this.validateRulesBean.applyAmt = this.commfunc.transform(createBean['creditMap']['applyAmt']).toString(); //申请金额格式转换
        this.validateRulesBean.idNo = this.commfunc.getSessionDataCH('idenNum'); //身份证号
        var loanProceed = JSON.parse(this.commfunc.getSessionDataCH('loanProceed'));
        for (var k in loanProceed) { //贷款用途
            switch (k) {
                case 'loanUse1':
                    this.validateRulesBean.IN_loanUser1 = loanProceed[k];
                    break;
                case 'loanUse2':
                    this.validateRulesBean.IN_loanUser2 = loanProceed[k];
                    break;
                case 'loanUse3':
                    this.validateRulesBean.IN_loanUser3 = loanProceed[k];
                    break;
            }
        }
        var toinvestTrade = JSON.parse(this.commfunc.getSessionDataCH('toinvestTrade'));
        for (var k in toinvestTrade) { //行业投向
            switch (k) {
                case 'ToinvestTrade1':
                    this.validateRulesBean.IN_industry1 = toinvestTrade[k];
                    break;
                case 'ToinvestTrade2':
                    this.validateRulesBean.IN_industry2 = toinvestTrade[k];
                    break;
                case 'ToinvestTrade3':
                    this.validateRulesBean.IN_industry3 = toinvestTrade[k];
                    break;
                case 'ToinvestTrade4':
                    this.validateRulesBean.IN_industry4 = toinvestTrade[k];
                    break;
            }
        }
        var questionValueList = JSON.parse(this.commfunc.getSessionDataCH('questionValueList')); //动态字段
        if (questionValueList && questionValueList.length != 0) {
            questionValueList.forEach(function (element1) {
                element1.forEach(function (element2) {
                    if (element2.productFeatureTypeId == 'PCA0010012') { //最高额合同编号
                        _this.validateRulesBean.contractNo = element2.value;
                    }
                    if (element2.productFeatureTypeId == 'PCA0000022') { //担保方式
                        _this.validateRulesBean.garanteeMode = element2.value;
                    }
                });
            });
        }
    };
    CommonViewPageComponent.prototype.submitCreditApprove = function (submitType, applyAmts, questionType, isCompleteCustInfo) {
        var _this = this;
        var approvalResult = '';
        switch (submitType) {
            case 1:
                approvalResult = '提交';
                break;
            case 2:
                approvalResult = '同意';
                break;
            case 3:
                approvalResult = '否决';
                break;
            case 4:
                approvalResult = '打回拟稿人';
                break;
            case 5:
                approvalResult = '打回上一节点';
                break;
            case 6:
                approvalResult = '追回';
                break;
            case '':
                approvalResult = '提交';
                break;
            default:
                approvalResult = '提交';
                break;
        }
        var queryParams = {
            'approvalOpinion': approvalResult,
            'submitType': submitType,
            'taskId': this.data.transferCreditData['taskId'],
            'processId': this.data.transferCreditData['processId'],
            // 'processId': this.viewPageData.processId,
            'custNo': this.data.transferCreditData['custNo'],
            'custRequestNo': this.data.transferCreditData['custRequestNo'],
            // 'custRequestNo': this.viewPageData.varMap.custRequestNo,
            'taskType': this.data.transferCreditData['varMap'].taskType,
            // 'custRequestNo':'10004',
            'workFlowAmt': applyAmts,
            'tellerNo': this.commonHeader['userId'],
            'pageBusiType': questionType,
            'commonMap': this.commonMap,
            'workEffortId': this.viewPageData.varMap.dataMap.workEffortId,
            'applyDate': this.viewPageData.varMap.dataMap.applyDate,
            'dataSource': this.viewPageData.varMap.dataMap.dataSource,
            'dataMap': this.viewPageData.varMap.dataMap
        };
        var commonHeader = JSON.parse(this.commfunc.getSessionData('commonHeader'));
        commonHeader['globalSeqNo'] = this.data.transferCreditData.mainFlowNo || '';
        this.commfunc.setSessionData('commonHeader', JSON.stringify(commonHeader));
        if (isCompleteCustInfo == 'N') {
            this.msgs = [];
            this.msgs.push({ severity: 'error', summary: '提示', detail: '信息不完整' });
            this.submitFlag = false;
            this.maskLayer = false;
            return;
        }
        this.creditCcmService.submitCreditApprove(queryParams).subscribe(function (data) {
            if (data.returnCode.code == 'success') {
                _this.submitFlag = false;
                _this.maskLayer = false;
                _this.msgs = [{ severity: 'info', summary: '信息', detail: '提交成功' }];
                //提交成功后消除标识
                // if (this.commfunc.getSessionDataCH('saveMSGIdentyfy') && this.commfunc.getSessionDataCH('saveMSGIdentyfy') == 'true') {
                //   this.commfunc.clearSession('saveMSGIdentyfy')
                // }
                _this.router.navigate(['/pages/tzb/custom/reminder-do/backlog-detail/btn-page/approve-page']);
                var s = JSON.parse(_this.commfunc.getSessionData('commonHeader'));
                if (s.extParam['specifyNextNode']) {
                    delete s.extParam['specifyNextNode'];
                    var commonHeader_1 = s;
                    _this.commfunc.setSessionData('commonHeader', JSON.stringify(commonHeader_1));
                }
            }
            else {
                _this.submitFlag = false;
                _this.maskLayer = false;
                var s = JSON.parse(_this.commfunc.getSessionData('commonHeader'));
                if (s.extParam['specifyNextNode']) {
                    delete s.extParam['specifyNextNode'];
                    var commonHeader_2 = s;
                    _this.commfunc.setSessionData('commonHeader', JSON.stringify(commonHeader_2));
                }
                _this.msgs = [{ severity: 'error', summary: '错误', detail: data.returnCode.message }];
                return;
            }
        });
    };
