    //获取担保方式和业务发生类型
    CommonViewPageComponent.prototype.queryDynamicProductAttributeOrValue = function (resolve) {
        var _this = this;
        var params = {
            // 产品编号传入
            'productId': this.data.transferCreditData['productNo'],
            //  客户请求编号
            'custRequestNo': this.data.transferCreditData['custRequestNo']
        };
        this.creditCcmService.queryProductAttributes(params).subscribe(function (data) {
            if (data.returnCode.code == 'success') {
                if (data.productFeatureList && data.productFeatureList.length > 0) {
                    for (var _i = 0, _a = data.productFeatureList; _i < _a.length; _i++) {
                        var item = _a[_i];
                        if (item.productFeatureTypeList && item.productFeatureTypeList.length > 0) {
                            for (var _b = 0, _c = item.productFeatureTypeList; _b < _c.length; _b++) {
                                var arr = _c[_b];
                                var atr = arr['productFeatureTypeId'];
                                if (atr == 'PCA0000022') {
                                    _this.PCA0000022ATR = arr[atr];
                                }
                                if (atr == 'PCA0000199') {
                                    _this.PCA0000199ATR = arr[atr];
                                }
                            }
                        }
                    }
                }
                //获取页签ID
                _this.questionType = '';
                for (var _d = 0, _e = _this.bookmarkList; _d < _e.length; _d++) {
                    var item = _e[_d];
                    switch (item.bookmarkId) {
                        case '110001': //共同借款人
                            _this.questionType = _this.questionType + "01|";
                            break;
                        case '60005':
                            //担保人
                            if (!(_this.PCA0000022ATR == '' || _this.PCA0000022ATR == '001')) {
                                _this.questionType = _this.questionType + "02|";
                            }
                            break;
                        case '110002': //积数冲减
                            _this.questionType = _this.questionType + "03|";
                            break;
                        case '60006': //还款计划信息
                            _this.questionType = _this.questionType + "04|";
                            break;
                        case '160000': //信用卡
                            //信用卡
                            if (_this.PCA0000199ATR == '0') {
                                _this.questionType = _this.questionType + "05|";
                            }
                            if (_this.PCA0000199ATR == '1') {
                                _this.questionType = _this.questionType + "07|";
                            }
                            if (_this.PCA0000199ATR == '2') {
                                _this.questionType = _this.questionType + "06|";
                            }
                            if (_this.PCA0000199ATR == '3') {
                                _this.questionType = _this.questionType + "08|";
                            }
                            break;
                        case '110005': //受托支付
                            _this.questionType = _this.questionType + "09|";
                            break;
                    }
                }
                _this.questionType = _this.questionType.slice(0, _this.questionType.length - 1);
                resolve({ questionType: _this.questionType });
            }
            else {
                _this.msgs = [{ severity: 'error', summary: '提示', detail: data.returnCode.message }];
            }
        });
    };
