    //查询投向行业下拉框的值，递归三次
    CreditCustNoproduct.prototype.queryTask = function (taskTypeParentId) {
        var _this = this;
        this.count++;
        var param_zone = {
            taskTypeParentId: taskTypeParentId,
            taskTypeKey: 'indtstryType'
        };
        this.httpService.taskTypeQry(param_zone).subscribe(function (data) {
            if (data.returnCode.code == 'success') {
                if (_this.count == 1) {
                    _this.secondToinvestTradeOptions = _this.commfunc.listToLabelvalue(data.taskTypeList, 'taskTypeName', 'taskTypeId');
                    _this.secondToinvestTradeOptions.unshift({ label: '请选择', value: '' });
                }
                else if (_this.count == 2) {
                    _this.thirdToinvestTradeOptions = _this.commfunc.listToLabelvalue(data.taskTypeList, 'taskTypeName', 'taskTypeId');
                    _this.thirdToinvestTradeOptions.unshift({ label: '请选择', value: '' });
                }
                else if (_this.count == 3) {
                    _this.fourthToinvestTradeOptions = _this.commfunc.listToLabelvalue(data.taskTypeList, 'taskTypeName', 'taskTypeId');
                    _this.fourthToinvestTradeOptions.unshift({ label: '请选择', value: '' });
                }
            }
            if (_this.count < 3) {
                _this.queryTask(_this.inverArr[_this.count]);
            }
        });
    };
    //投向行业查询
    CreditCustNoproduct.prototype.queryTaskByIndtstryAll = function (taskTypeId) {
        var _this = this;
        debugger;
        var params = {
            taskTypeId: taskTypeId,
            taskTypeKey: 'indtstryType'
        };
        this.creditCcmService.queryTaskByIndtstryAll(params).subscribe(function (data) {
            if (data.returnCode.code == 'success') {
                data.taskList.forEach(function (ele) {
                    _this.inverArr.unshift(ele['taskTypeId']);
                });
                //投向行业回显
                _this.firstToinvestTrade = _this.inverArr[0];
                _this.secondToinvestTrade = _this.inverArr[1];
                _this.thirdToinvestTrade = _this.inverArr[2];
                _this.fourthToinvestTrade = _this.inverArr[3];
                _this.queryTask(_this.inverArr[_this.count]);
            }
        });
    };
    // 客户详细信息查询
    CreditCustNoproduct.prototype.queryCustNeedInfo = function () {
        var _this = this;
        var param = {
            custNo: this.custNo
        };
        this.creditCcmService.queryCustNeedInfo(param).subscribe(function (data) {
            if (data.returnCode.code == 'success') {
                ////////console.log(data)
                if (data.dataSourceId == 'BR00A') {
                    var commonHeader = JSON.parse(_this.commfunc.getSessionData('commonHeader'));
                    commonHeader.extParam['custTargetId'] = '101010';
                    _this.commfunc.setSessionData('commonHeader', JSON.stringify(commonHeader));
                }
                else if (data.dataSourceId == 'BR00B') {
                    var commonHeader = JSON.parse(_this.commfunc.getSessionData('commonHeader'));
                    commonHeader.extParam['custTargetId'] = '101011';
                    _this.commfunc.setSessionData('commonHeader', JSON.stringify(commonHeader));
                }
                else if (!data.dataSourceId.dataSourceId || data.dataSourceId.dataSourceId == '' || data.dataSourceId.dataSourceId == null) {
                    var commonHeader = JSON.parse(_this.commfunc.getSessionData('commonHeader'));
                    commonHeader.extParam['custTargetId'] = '';
                    _this.commfunc.setSessionData('commonHeader', JSON.stringify(commonHeader));
                }
                for (var i in data) {
                    if (i == 'birthDate' && data[i] == 'null') {
                        data[i] = '';
                    }
                }
                _this.creditCustBean = data;
                _this.creditCustBean = JSON.parse(JSON.stringify(data));
                _this.occupationQuery(data);
                delete _this.creditCustBean['regAmt'];
                delete _this.creditCustBean['returnCode'];
                if (data.birthDate) {
                    _this.birthDate = new Date(data.birthDate);
                }
                _this.queryFarmily(); //家庭信息
                _this.query1(); //行政信息
                _this.queryTaskByIndtstryAll(data['investTrade']);
                _this.queryMange(data);
                _this.queryOrg(data);
            }
            else {
                _this.errorMsgs = [{ severity: 'error', summary: '错误', detail: data.returnCode.message }];
            }
        });
    };
    // 修改企业客户信息
    CreditCustNoproduct.prototype.updateCustEnter = function () {
        var _this = this;
        if (this.creditCustBean.whetherBlocCust == '1') { //是
            if (!this.creditCustBean.blocCustCode) {
                this.isBlocCust = true;
                this.msgs = [{ severity: 'error', summary: '提示：', detail: '集团客户号不能为空' }];
                return;
            }
        }
        //校验的
        for (var i in this.myformChild.controls) {
            this.myformChild.controls[i].markAsDirty();
        }
        //处理是否提交
        for (var i in this.myformChild.controls) {
            if (!this.myformChild.controls[i].valid) {
                return;
            }
        }
        //所在行政区划：
        if (this.province && !this.city && !this.zone && !this.street) {
            this.creditCustBean.address1 = this.province;
        }
        else if (this.province && this.city && !this.zone && !this.street) {
            this.creditCustBean.address1 = this.city;
        }
        else if (this.province && this.city && this.zone && !this.street) {
            this.creditCustBean.address1 = this.zone;
        }
        else if (this.province && this.city && this.zone && this.street) {
            this.creditCustBean.address1 = this.street;
        }
        //家庭地址街道：
        if (this.province_3 && !this.city_3 && !this.zone_3 && !this.street_3) {
            this.creditCustBean.address3 = this.province_3;
        }
        else if (this.province_3 && this.city_3 && !this.zone_3 && !this.street_3) {
            this.creditCustBean.address3 = this.city_3;
        }
        else if (this.province_3 && this.city_3 && this.zone_3 && !this.street_3) {
            this.creditCustBean.address3 = this.zone_3;
        }
        else if (this.province_3 && this.city_3 && this.zone_3 && this.street_3) {
            this.creditCustBean.address3 = this.street_3;
        }
        // myForm['birthDate'] = this.commfunc.transDateN(myForm.birthDate);
        // myForm['custNo'] = this.custNo;
        // myForm['investTrade'] = myForm['fourthToinvestTrade']//转换投向行业入参
        this.creditCustBean.custNo = this.custNo;
        this.creditCustBean['birthDate'] = this.commfunc.transDateN(this.birthDate);
        this.creditCustBean['investTrade'] = this.fourthToinvestTrade;
        // this.creditCustBean.address1 = this.province;
        this.creditCcmService.updateCustComposite(this.creditCustBean).subscribe(function (data) {
            if (data.returnCode.code == 'success') {
                _this.communicationService.sendData.emit(true);
                _this.msgs = [{ severity: 'success', summary: '提示：', detail: '保存成功' }];
                _this.closeDialog.emit();
                return;
            }
            else {
                _this.errorMsgs = [{ severity: 'error', summary: '错误', detail: data.returnCode.message }];
                return;
            }
        });
    };
