    CreditCustProduct.prototype.queryCustNeedInfo = function () {
        var _this = this;
        var param = {
            custNo: this.custNo
            // custNo: '5100029196'
        };
        this.creditCcmService.queryCustNeedInfo(param).subscribe(function (data) {
            if (data.returnCode.code == 'success') {
                if (data.dataSourceId == 'BR00A') {
                    var commonHeader = JSON.parse(_this.commfunc.getSessionData('commonHeader'));
                    commonHeader.extParam['custTargetId'] = '101010';
                    _this.commfunc.setSessionData('commonHeader', JSON.stringify(commonHeader));
                }
                else if (data.dataSourceId == 'BR00B') {
                    var commonHeader = JSON.parse(_this.commfunc.getSessionData('commonHeader'));
                    commonHeader.extParam['custTargetId'] = '101011';
                    _this.commfunc.setSessionData('commonHeader', JSON.stringify(commonHeader));
                }
                else if (!data.dataSourceId.dataSourceId || data.dataSourceId.dataSourceId == '' || data.dataSourceId.dataSourceId == null) {
                    var commonHeader = JSON.parse(_this.commfunc.getSessionData('commonHeader'));
                    commonHeader.extParam['custTargetId'] = '';
                    _this.commfunc.setSessionData('commonHeader', JSON.stringify(commonHeader));
                }
                for (var i in data) {
                    if (i == 'birthDate' && data[i] == 'null') {
                        data[i] = '';
                    }
                }
                _this.creditCustBean = data;
                _this.creditCustBean = JSON.parse(JSON.stringify(data));
                delete _this.creditCustBean['regAmt'];
                delete _this.creditCustBean['returnCode'];
                if (data.birthDate) {
                    _this.birthDate = new Date(data.birthDate);
                }
                _this.queryFarmily(); //家庭信息
                _this.query1(); //行政信息
                _this.queryTaskByIndtstryAll(data['investTrade']);
                _this.queryMange(data);
                _this.queryOrg(data);
                debugger;
                if (data.investTrade && data.investTrade != '') {
                    _this.investTrade = data.investTrade;
                    _this.queryPartyEntType(1);
                }
            }
            else {
                _this.errorMsgs = [{ severity: 'error', summary: '错误', detail: data.returnCode.message }];
            }
        });
    };
