    CreditCustProduct.prototype.companyTypeCheck = function (event, index) {
        debugger;
        if (event) {
            if (index == '1') {
                if (Object(app_uisftech_common_service_validator__WEBPACK_IMPORTED_MODULE_8__["checkNumber"])(null, event.target.value)) {
                    this.msgs = [{ severity: 'error', summary: '提示', detail: '当前输入框内只能输入数字' }];
                    event.target.value = '';
                }
            }
            else {
                if (Object(app_uisftech_common_service_validator__WEBPACK_IMPORTED_MODULE_8__["sixthTwoNum"])(null, event.target.value)) {
                    this.msgs = [{ severity: 'error', summary: '提示', detail: '所输金额必须为0-16位正整数或0-16位正整数保留两位小数' }];
                    event.target.value = '';
                }
            }
        }
        if (this.entList.length > 0 && this.creditCustBean.employeesNumber && this.creditCustBean.employeesNumber != '' && this.creditCustBean.employeesNumber != null && String(this.creditCustBean.custAssetsTotalamount) != null && String(this.creditCustBean.custAssetsTotalamount) && this.creditCustBean.custYearOutputvalue != null && String(this.creditCustBean.custAssetsTotalamount) != '' && String(this.creditCustBean.custYearOutputvalue) && String(this.creditCustBean.custYearOutputvalue) != '') {
            var per = '4';
            var ann = '4';
            var ass = '4';
            var val = void 0;
            if (this.entList[0].persDown > 0) {
                if (Number.parseFloat(this.creditCustBean.employeesNumber) >= this.entList[0].persDown * 1) {
                    per = "4";
                }
                else if (Number.parseFloat(this.creditCustBean.employeesNumber) >= this.entList[0].persUp * 1 && Number.parseFloat(this.creditCustBean.employeesNumber) < this.entList[0].persDown * 1) {
                    per = this.entList[0].entType;
                }
                else if (Number.parseFloat(this.creditCustBean.employeesNumber) >= this.entList[1].persUp * 1 && Number.parseFloat(this.creditCustBean.employeesNumber) < this.entList[1].persDown * 1) {
                    per = this.entList[1].entType;
                }
                else if (Number.parseFloat(this.creditCustBean.employeesNumber) >= this.entList[2].persUp * 1 && Number.parseFloat(this.creditCustBean.employeesNumber) < this.entList[2].persDown * 1) {
                    per = this.entList[2].entType;
                }
            }
            if (this.entList[0].annProdDown > 0) {
                if (Number.parseFloat(this.creditCustBean.custYearOutputvalue) >= this.entList[0].annProdDown * 1) {
                    ann = "4";
                }
                else if (Number.parseFloat(this.creditCustBean.custYearOutputvalue) >= this.entList[0].annProdUp * 1 && Number.parseFloat(this.creditCustBean.custYearOutputvalue) < this.entList[0].annProdDown * 1) {
                    ann = this.entList[0].entType;
                }
                else if (Number.parseFloat(this.creditCustBean.custYearOutputvalue) >= this.entList[1].annProdUp * 1 && Number.parseFloat(this.creditCustBean.custYearOutputvalue) < this.entList[1].annProdDown * 1) {
                    ann = this.entList[1].entType;
                }
                else if (Number.parseFloat(this.creditCustBean.custYearOutputvalue) >= this.entList[2].annProdUp * 1 && Number.parseFloat(this.creditCustBean.custYearOutputvalue) < this.entList[2].annProdDown * 1) {
                    ann = this.entList[2].entType;
                }
            }
            if (this.entList[0].assetDown > 0) {
                if (Number.parseFloat(this.creditCustBean.custAssetsTotalamount) >= this.entList[0].assetDown * 1) {
                    ass = "4";
                }
                else if (Number.parseFloat(this.creditCustBean.custAssetsTotalamount) >= this.entList[0].assetUp * 1 && Number.parseFloat(this.creditCustBean.custAssetsTotalamount) < this.entList[0].assetDown * 1) {
                    ass = this.entList[0].entType;
                }
                else if (Number.parseFloat(this.creditCustBean.custAssetsTotalamount) >= this.entList[1].assetUp * 1 && Number.parseFloat(this.creditCustBean.custAssetsTotalamount) < this.entList[1].assetDown * 1) {
                    ass = this.entList[1].entType;
                }
                else if (Number.parseFloat(this.creditCustBean.custAssetsTotalamount) >= this.entList[2].assetUp * 1 && Number.parseFloat(this.creditCustBean.custAssetsTotalamount) < this.entList[2].assetDown * 1) {
                    ass = this.entList[2].entType;
                }
            }
            if (per == "3" || ann == "3" || ass == "3") {
                val = "3";
            }
            else {
                if (per == "2" || ann == "2" || ass == "2") {
                    val = "2";
                }
                else {
                    if (per == "1" || ann == "1" || ass == "1") {
                        val = "1";
                    }
                    else {
                        val = "4";
                    }
                }
            }
            this.creditCustBean.smeType = val;
        }
        else {
            this.creditCustBean.smeType = '';
        }
    };
