    // 根据客户号查询客户信息
    GuarantorDialog.prototype.queryCusts = function () {
        var _this = this;
        var commonHeader = JSON.parse(this.commfunc.getSessionData('commonHeader'));
        var headerDataSourceId = '';
        if ((commonHeader.targetId).endsWith('0')) {
            headerDataSourceId = 'BR00A';
        }
        else if ((commonHeader.targetId).endsWith('1')) {
            headerDataSourceId = 'BR00B';
        }
        else {
            this.msgs = [];
            this.msgs = [{ severity: 'error', summary: '提示', detail: commonHeader.targetId + '最后一位即非0已非1' }];
        }
        var params = {
            'custNo': this.guarantorBean.custNo
        };
        // 调用查询客户中心接口，查询客户相关信息
        this.creditCcmService.queryCustNeedInfo(params).subscribe(function (data) {
            if (data.returnCode.code === 'success') {
                // check:当前登录和客户必须同事是台州银行或村镇银行的
                if (data.dataSourceId !== headerDataSourceId) {
                    _this.msgs = [];
                    _this.msgs = [{ severity: 'error', summary: '错误', detail: '该客户不存在，请重新输入' }];
                    return;
                }
                // 客户姓名
                _this.guarantorBean.custName = data.custName;
                // 查询债务信息
                setTimeout(function () {
                    _this.queryEsbDebtInfo(_this.guarantorBean.custNo, _this.guarantorBean.custName);
                }, 100);
                if (data.custAttribute !== '1' && data.custAttribute !== '2') {
                    _this.msgs = [];
                    _this.msgs = [{ severity: 'error', summary: '错误', detail: '非个人客户，无法计算年龄' }];
                    return;
                }
                if (!data.birthDate) {
                    _this.msgs = [];
                    _this.msgs = [{ severity: 'error', summary: '错误', detail: '出生日期为' + data.birthDate + ',无法计算客户年龄' }];
                    return;
                }
                // 获取客户年龄
                var customerAge = _this.getCustomerAge(data.birthDate);
                if (customerAge < 0) {
                    _this.msgs = [];
                    _this.msgs = [{ severity: 'error', summary: '错误', detail: '出生日期大于当前日期' }];
                    return;
                }
                // check : 20<客户年龄<60
                if (customerAge <= 20 || customerAge >= 60) {
                    _this.msgs = [];
                    _this.msgs = [{ severity: 'error', summary: '错误', detail: '客户年龄' + customerAge + ',不符合规范' }];
                }
            }
            else {
                _this.msgs = [];
                _this.msgs = [{ severity: 'error', summary: '提示', detail: data.returnCode.message }];
            }
        });
        // 校验担保人信息完整 added by yuanzhenghe20190417
        this.checkGuarantorInfo();
    };
