    // 新增担保人
    GuarantorDialog.prototype.addCreditGuarantor = function () {
        if (!this.preValidateForSubmit())
            return;
        // check 引用最高额时，每次修改的担保金额必须大于等于申请金额(来自前面授信登记写的申请金额)
        if (Number(this.getApplyAmountFromCredit) > Number(this.guarantorBean.useAmt)) {
            this.msgs = [];
            this.msgs.push({ severity: 'error', summary: '错误', detail: '担保金额不能小于申请金额，请重新录入' });
            return;
        }
        // check 信用卡合同方式只允许选择普通，请确认！
        if ((this.inValue['creditCardElement'] && this.inValue['creditCardElement'] === 'creditCardElementSendCustRequestNo') ||
            (this.inputValueData && this.inputValueData.parentData && this.inputValueData.parentData.varMap && this.inputValueData.parentData.varMap.taskCategoryId === 'RUM0009')) {
            if (this.guarantorBean.contractMode != '01') { // 不为'普通'
                this.msgs = [];
                this.msgs.push({ severity: 'error', summary: '提示', detail: '信用卡合同方式只允许选择普通，请确认！' });
                return;
            }
        }
        if (this.guarantorBean.useAmt) { //本次抵押金额判断
            this.pledgeAmtChange('1');
        }
        if (this.guarantorBean.contractAmt) { //
            this.pledgeAmtChange('2');
        }
        this.doChangeAmt('del', 'guaranteeContractAmt'); //金额去除格式
        this.doChangeAmt('del', 'useAmt'); //金额去除格式        
        this.guarantorBean.guaranteeMode = '保证';
        if (!this.guaranteeStartDate.length) {
            this.guarantorBean.guaranteeStartDate = this.commfunc.transDateN(this.guaranteeStartDate);
        }
        else {
            this.guarantorBean.guaranteeStartDate = this.guaranteeStartDate;
        }
        if (!this.guaranteeEndDate.length) {
            this.guarantorBean.guaranteeEndDate = this.commfunc.transDateN(this.guaranteeEndDate);
        }
        else {
            this.guarantorBean.guaranteeEndDate = this.guaranteeEndDate;
        }
        this.outputValue.emit(this.guarantorBean);
        this.blockedPaneladd = false;
    };
