    // 获取客户年龄
    GuarantorDialog.prototype.getCustomerAge = function (customerBirthDate) {
        var birthDataArray = customerBirthDate.split('-');
        var birthYear = birthDataArray[0];
        var birthMonth = birthDataArray[1];
        var birthDay = birthDataArray[2];
        var d = new Date();
        var nowYear = d.getFullYear();
        var nowMonth = d.getMonth() + 1;
        var nowDay = d.getDay();
        var returnAge;
        if (nowYear == Number(birthYear)) {
            returnAge = 0;
        }
        else {
            var ageDiff = nowYear - Number(birthYear);
            if (ageDiff > 0) {
                if (nowMonth == Number(birthMonth)) {
                    var dayDiff = nowDay - Number(birthDay);
                    if (dayDiff < 0) {
                        returnAge = ageDiff - 1;
                    }
                    else {
                        returnAge = ageDiff;
                    }
                }
                else {
                    var monthDiff = nowMonth - Number(birthMonth);
                    if (monthDiff < 0) {
                        returnAge = ageDiff - 1;
                    }
                    else {
                        returnAge = ageDiff;
                    }
                }
            }
            else {
                returnAge = -1;
            }
        }
        return returnAge;
    };
