    // 通过接口查询授信申请详细信息
    PledgeDialog.prototype.queryGuaranteeDetail = function (custRequestNo) {
        var _this = this;
        var param = {
            'custRequestNo': custRequestNo,
        };
        this.creditCcmService.queryCreditResult(param).subscribe(function (data) {
            if (data.returnCode.code === 'success') {
                if (data.list[0].length < 1) {
                    _this.msgs = [];
                    _this.msgs.push({ severity: 'error', summary: '错误', detail: '查询授信登记数据为空' });
                    return;
                }
                var result = data.list[0];
                _this.businessType = result.businessType;
                if (_this.businessType && _this.businessType != '06') {
                    _this.pledgeBean.contractMode = result.contractPattern;
                }
                else {
                    _this.endDateReadonly = true;
                    _this.startDateReadonly = true;
                }
                var contractMode = result.contractPattern;
                _this.contractPatterns = result.contractPattern;
                // 合同方式——‘引用最高额’或‘普通’——需要相应的处理
                if (contractMode === '01') { //普通
                    _this.ordinaryReadonly = true;
                    _this.contractModeChange('01');
                }
                else if (contractMode === '03') { //引用最高额
                    _this.ordinaryReadonly = false;
                    // this.contractModeList1 = [];
                    // this.contractModeList.forEach(item => {
                    //     if (item.value == '01' || item.value == '03') {
                    //         this.contractModeList1.push(item);
                    //     }
                    // });
                    _this.contractModeChange('03');
                }
                else if (contractMode === '04') { //引用互助担保基金协议
                    _this.ordinaryReadonly = false;
                    _this.contractModeChange('04');
                }
                if (result.startDate) {
                    _this.pledgeBean.guaranteeStartDate = result.startDate;
                }
                else {
                    _this.pledgeBean.guaranteeStartDate = '';
                    _this.msgs = [];
                    _this.msgs = [{ severity: 'info', summary: '提示', detail: '担保起始日期无返回值!' }];
                }
                _this.pledgeBean.guaranteeEndDate = result.endDate;
                // 加固处理申请金额
                _this.getApplyAmountFromCredit = _this.inputValueData['parentData'].applyAmt;
            }
            else {
                _this.msgs = [];
                _this.msgs = [{ severity: 'error', summary: '错误', detail: data.returnCode.message }];
            }
        });
    };
