    /**转化贷款金额不能高于合同金额（授信金额）
     * 追加：先判断不能高于上笔转化金额，上笔转化金额不存在然后再判断授信金额
     */
    TransformLoanAddComponent.prototype.compareMoney = function (item) {
        if (item && item != '') {
            this.convertContractAmount = this.decimalPipe.transform(item / 1, '1.2-2');
            this.transformLoanAddBean.convertContractAmount = item;
            var money = item.replace(/\,/g, '');
            if (money % 100 != 0) {
                this.msgs = [];
                this.msgs.push({ severity: 'error', summary: '提示', detail: '转化金额必须为100的整数倍!' });
                return true;
            }
            if (this.transformLoanAddBean.lastConvertContractAmount
                && this.transformLoanAddBean.lastConvertContractAmount != ''
                && this.transformLoanAddBean.convertFrequency
                && this.transformLoanAddBean.convertFrequency > '1') {
                var money1 = this.transformLoanAddBean.lastConvertContractAmount.replace(/\,/g, '');
                if (Number(money) > Number(money1)) {
                    this.msgs = [];
                    this.msgs.push({ severity: 'error', summary: '提示', detail: '转化金额不能高于上笔转化金额!' });
                    return true;
                }
            }
            else {
                if (this.transformLoanAddBean.loanAmt && this.transformLoanAddBean.loanAmt != '') {
                    var money2 = this.transformLoanAddBean.loanAmt.replace(/\,/g, '');
                    if (Number(money) > Number(money2)) {
                        this.msgs = [];
                        this.msgs.push({ severity: 'error', summary: '提示', detail: '转化金额不能高于授信金额!' });
                        return true;
                    }
                }
            }
        }
    };
