    //转化金额必须为100的整数倍
    TransformLoanAddComponent.prototype.doCheck = function (param) {
        var money = param.replace(/\,/g, '');
        var regAmtJy = /^([1-9][0-9]*[0]{2})?$/;
        if (!regAmtJy.test(money) && parseInt(money) != 0) {
            this.msgs = [];
            this.msgs.push({ severity: 'error', summary: '提示', detail: '转化金额必须为100的整数倍!' });
            return true;
        }
    };
